import React from 'react';
import "./topbar.css";

function Topbar() {
    return (
        <div className="topbarContainer">
            <div className="topbarLeft">
                <span className="logo"></span>
            </div>
            <div className="topbarCenter"></div>
            <div className="topbarRight"></div>

        </div>
    )
}

export default Topbar
